rule-providers:
    AWAvenue-Ads: { type: http, behavior: domain, format: yaml, path: ./rule_provider/AWAvenue-Ads.yaml, url: 'https://cdn.gh-proxy.com/https://raw.githubusercontent.com/TG-Twilight/AWAvenue-Ads-Rule/refs/heads/main/Filters/AWAvenue-Ads-Rule-Clash.yaml', interval: 86400 }
mode: rule
ipv6: true
log-level: info
allow-lan: true
mixed-port: 7890
unified-delay: true
tcp-concurrent: true
external-controller: ':9090'
geodata-mode: true
geox-url:
    geoip: 'https://cdn.gh-proxy.com/https://github.com/MetaCubeX/meta-rules-dat/releases/download/latest/geoip.dat'
    geosite: 'https://cdn.gh-proxy.com/https://github.com/MetaCubeX/meta-rules-dat/releases/download/latest/geosite.dat'
    mmdb: 'https://cdn.gh-proxy.com/https://github.com/MetaCubeX/meta-rules-dat/releases/download/latest/geoip.metadb'
    asn: 'https://cdn.gh-proxy.com/https://github.com/MetaCubeX/meta-rules-dat/releases/download/latest/GeoLite2-ASN.mmdb'
find-process-mode: strict
keep-alive-interval: 1800
global-client-fingerprint: random
profile:
    store-selected: true
    store-fake-ip: true
ntp:
    enable: true
    write-to-system: false
    server: time.apple.com
    port: 123
    interval: 30
sniffer:
    enable: true
    sniff: { TLS: { ports: [443, 8443] }, HTTP: { ports: [80, 8080-8880], override-destination: true } }
tun:
    enable: true
    stack: gvisor
    dns-hijack: ['any:53', 'tcp://any:53']
    auto-route: true
    auto-detect-interface: true
dns:
    enable: true
    listen: ':1053'
    ipv6: true
    enhanced-mode: redir-host
    fake-ip-range: 28.0.0.1/8
    fake-ip-filter: ['*', +.lan, +.local]
    default-nameserver: [223.5.5.5, 119.29.29.29, 114.114.114.114, '[2402:4e00::]', '[2400:3200::1]']
    nameserver: ['tls://8.8.4.4#dns', 'tls://1.0.0.1#dns', 'tls://[2001:4860:4860::8844]#dns', 'tls://[2606:4700:4700::1001]#dns']
    proxy-server-nameserver: ['https://doh.pub/dns-query']
    nameserver-policy: { 'geosite:cn,private': ['https://doh.pub/dns-query', 'https://dns.alidns.com/dns-query'], 'geosite:!cn,!private': ['tls://dns.google#dns', 'tls://cloudflare-dns.com#dns'] }
